export const removeUserUtilits = (userId, state) => {
  const { usersList } = state

  const usersListAfterFilter = usersList.filter((user) => user._id !== userId)
  console.log(usersListAfterFilter)
  return { ...state, usersList: usersListAfterFilter }
}
